import React from 'react';
import GenderDropdown from './dropdowns/Gender';
import { Genders } from './dropdowns/menus/options'; // Importing Genders from options.js
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedGender: '',
    };
  }

  handleSelectGender = (selectedOption) => {
    this.setState({ selectedGender: selectedOption.value });
  };

  handleSubmit = () => {
    const { selectedGender } = this.state;
    if (!selectedGender) {
      alert('Please select a gender.');
      return;
    }
    console.log('Selected gender:', selectedGender);
    // Perform further actions with the selected gender
  };

  render() {
    const { selectedGender } = this.state;

    return (
      <div className="App">
        <h1>Gender Selection</h1>
        <GenderDropdown options={Genders} onSelectGender={this.handleSelectGender} />
        <button onClick={this.handleSubmit}>Submit</button>
      </div>
    );
  }
}

export default App;
